(10, 'Terasa Istimewa dan Sempurna', '<p>\n	<span style=\"font-size:14px;\"><span style=\"color: rgb(85, 85, 85); font-family: \'trebuchet ms\', helvetica, sans-serif; line-height: 20px; text-align: justify;\">WADIMOR sarung khas Indonesia, sudah mengakar begitu kuat dalam keaneka ragaman budaya Indonesia. Begitu juga dengan Sarung WADIMOR, begitu kaya akan motif dan corak. Terasa Istimewa dan lebih Sempurna saat memakainya</span></span></p>\n', '<p style=\"text-align: justify;\">\n	<span style=\"font-size:8px;\"><tt><span style=\"color: rgb(85, 85, 85); font-family: \'trebuchet ms\', helvetica, sans-serif; line-height: 20px; text-align: justify;\">WADIMOR sarung khas Indonesia, sudah mengakar begitu kuat dalam keaneka ragaman budaya Indonesia. Begitu juga dengan Sarung WADIMOR, begitu kaya akan motif dan corak. Terasa Istimewa dan lebih Sempurna saat memakainya</span></tt></span></p>\n', '', 'wadimor', NULL, '1', '1', NULL, '2014-04-08 06:00:38');
